#include <iostream>
#include <vector>
#include <algorithm>
using namespace std;
int main()
{
    int n, k;
    cin >> n >> k;
    vector<int> a(n);
    for (int i = 0; i < n; i++)
    {
        cin >> a[i];
    }
    sort(a.begin(), a.end());
    int ans = 0;
    for (int i = 0; i < n; i++)
    {
        if (a[i] > k)
        {
            ans++;
            k = a[i];
        }
    }
    cout << ans;
    return 0;
}

def solve():
    n, k = list(map(int, input().split()))
    a = list(map(int, input().split()))
    for i in range(n):
        if a[i] > k:
            return i
    return n

print(solve())
